import axios from "axios";
import res from "express/lib/response";
import React, { useState } from "react";
import useInput from "../hooks/Useimput";
const Login = () => {
  const name = useInput();
  const email = useInput();
  const password = useInput();

  //   const [name, setName] = useState("");
  //   const [email, setEmail] = useState("");
  //   const [password, setPassword] = useState("");

  //   const handleName = (e) => {
  //     setName(e.target.value);
  //   };

  //   const handleEmail = (e) => {
  //     setEmail(e.target.value);
  //   };

  //   const handlePassword = (e) => {
  //     setPassword(e.target.value);
  //   };
  const handlerSumit = (e) => {
    e.preventDefault();
    axios
    .post("http://localhost:1337/api/users", {
      name: name.value,
      email: email.value,
      password: password.value,
    })
    .then(res=>res.data)
    .then(data=>res.send(data));
    console.log(name.value, email.value, password.value);
  };

  return (
    <form onSubmit={handlerSumit}>
      <div class="mb-3">
        <label for="validationCustom0" class="form-label">
          Name
        </label>
        <input
          {...name}
          type="text"
          class="form-control"
          id="exampleInputEmail1"
          aria-describedby="emailHelp"
        />
      </div>
      <div class="mb-3">
        <label for="exampleInputEmail1" class="form-label">
          Email address
        </label>
        <input
          {...email}
          type="email"
          class="form-control"
          id="exampleInputEmail1"
          aria-describedby="emailHelp"
          placeholder="Well never share your email with anyone else"
        />
      </div>
      <div class="mb-3">
        <label for="exampleInputPassword1" class="form-label">
          Password
        </label>
        <input
          {...password}
          type="password"
          class="form-control"
          id="exampleInputPassword1"
        />
      </div>
      <div class="mb-3 form-check">
        <input type="checkbox" class="form-check-input" id="exampleCheck1" />
        <label class="form-check-label" for="exampleCheck1">
          Check me out
        </label>
      </div>
      <button type="submit" class="btn btn-primary">
        Submit
      </button>
    </form>
  );
};

export default Login;
